Como alternativa, se um objeto namespace global já foi definido, a função módulo pode simples-
mente configurar propriedades desse objeto diretamente e não se preocupar em retornar nada:
var collections;
if (!collections) collections = {};
collections.sets = {};
(function namespace() {
    // ... Bastante código omitido...
    // Agora exporta nossa API pública para o objeto namespace criado anteriormente
    collections.sets.AbstractSet = AbstractSet;
    collections.sets.NotSet = NotSet;   // E assim por diante...
